package com.nextswe.prep.leetcode.daily;

public class P392 {
    //had to try multiple times to find all the cases
    //need improvement on that
    public boolean isSubsequence(String s, String t) {
        //"b" = 1 //ns
        //"c" = 1 //nt
        if (s.length() == 0) return true;
        int i=0,j=0;
        int ns = s.length();
        int nt = t.length();
        while(j<nt){
            if(t.charAt(j)==s.charAt(i)){
                i++;
                if(i==ns){
                    return true;
                }
            }
            j++;
        }
        return false;
    }

    public static void main(String[] args){
        P392 mP392 = new P392();
        System.out.println(mP392.isSubsequence("abc",
                "ahbgdc"));
        System.out.println(mP392.isSubsequence("axc",
                "ahbgdc"));
        System.out.println(mP392.isSubsequence("b",
                "c"));
        System.out.println(mP392.isSubsequence("",
                ""));
        System.out.println(mP392.isSubsequence("",
                "b"));
        System.out.println(mP392.isSubsequence("leeeeetcode",
                ""));
    }
}
